import React from "react";
import "./message.css";

const Message = ({ user, message, classs }) => {
  if (user) {
    return <div className={`messageBox ${classs}`}>{`${user}:${message}`}</div>;
  } else {
    <div className="messageBox left ">{`You:${message}`}</div>;
  }
};

export default Message;
